query:
BEGIN;
UPDATE places SET atollId = (SELECT id FROM atolls WHERE name = 'Alif Alifu Atoll') WHERE name IN ('Maalhos', 'Kan''dholhudhoo', 'Vihamaafaru', 'Maayafushi', 'Gangehi', 'Halaveli', 'Etheremadivaru', 'Velidhoo', 'Bodufolhudhoo', 'Thoddoo', 'Madivaru', 'Madivarufinolhu', 'Velifinolhu', 'Madoogali', 'Mushimasmigili', 'Fushi', 'Himandhoo', 'Kudafolhudhoo', 'Ukulhas', 'Gaathafushi', 'Fesdhoo', 'Bathalaa', 'Fusfinolhu', 'Kuramathi', 'Dhinnolhufinolhu', 'Mathivereefinolhu', 'Veligan''du') AND type = 'island';
UPDATE places SET atollId = (SELECT id FROM atolls WHERE name = 'Alif Dhaal Atoll') WHERE name IN ('Omadhoo', 'Ariyadhoo', 'Dhiffushi', 'Dhigurah', 'Fenfushi', 'Mahibadoo', 'Dhangethi', 'Dhiddhoo', 'Veligandu', 'Bodufinolhu') AND type = 'island';
UPDATE places SET atollId = (SELECT id FROM atolls WHERE name = 'Baa Atoll') WHERE name IN ('Eydhafushi', 'Felidhoo', 'Hirilandhoo', 'Fulhadhoo', 'Th''edhoo', 'Dharavandhoo', 'Meedhoo', 'Godhoo', 'Kihaadhoo', 'Baarah', 'Goidhoo', 'Dhaalu', 'Hoarafushi') AND type = 'island';
COMMIT;

